import React from "react";

const New = () => {
  const handleSubmit = e => {
    console.log(e);
  };
  return (
    <div className="center">
      <h1>Meetup Form</h1>
      <form>
        <label> Meetup Name: <input className="one" type="text" /></label>
        <br />
        <label> Meetup Description:
        <input className="two" type="text" /></label>
        <br />
        <label> Meetup Organization:
        <input className="three" type="text" /></label>
        <br />
        <label> Meetup Contact.No:
        <input className="four" type="text" /></label>
        <br />
        <label> Meetup Date:</label> <input className="five" type="date" />
        <br />
        <label> Meetup Address: 
        <input className="six" type="text" /></label>
        <br />
        <button className="button" onSubmit={handleSubmit}>

          Sumbit
        </button>
      </form>
    </div>
  );
};

export default New;
